const Result = ({score, playAgain}) => (


  <div className="score-board">
    <div className="score">
      <p>Tu puntaje es: <b>{score}</b></p>
      <button className="playBtn" onClick={playAgain}>
      Otra Vez
    </button>
    </div>
  </div>
);

function UserGreeting(props) {
  return <h1>Welcome back!</h1>;
}

export default Result;
